// creating product object in literal style
let product1 = {
    name: "Laptop",
    price: 999.99,
    brand: "Dell",
    model: "XPS 13",
    imageURL: "data:image/jpeg;base64,"
};
let product2={
    name:"Smartphone",
    price:499.99,
    brand:"Samsung",
    model:"Galaxy S21",
    imageURL: "data:image/jpeg;base64,"
}
let product3 = {
    name: "Headphones",
    price: 199.99,
    brand: "Sony",
    model: "WH-1000XM4",
    imageURL: "data:image/jpeg;base64,"
}
let products =[product1,product2,product3];
document.write("<h2>Product List:</h2>");
products.forEach((product)=>{
    document.write("Product Name: " + product.name + "<br>");
    document.write("Price: $" + product.price + "<br>");
    document.write("Brand: " + product.brand + "<br>");
    document.write("Model: " + product.model + "<br>");
    document.write("<img src='" + product.imageURL + "' alt='" + product.name + "' width='200px' height='200px'><br><br>");
})